s($,"aB2","PU",function(){var q=null,p=t.p
return P.aE(["intro","Sou um futuro cientista da computa\xe7\xe3o que al\xe9m de apaixonado por desenvolver solu\xe7\xf5es que resolvem problemas especialmente para plataformas m\xf3veis, tenho uma ambi\xe7\xe3o especial em construir aplica\xe7\xf5es com visual de alto n\xedvel, perfeitamente alinhados em cada pixel de modo a entregar uma experi\xeancia fluida tanto no UX Front-End como no desempenho do Back-End. Aprender coisas novas definitivamente \xe9 algo que eu amo, ent\xe3o, creio que a melhor forma de potencializar isso \xe9 me integrando num ambiente que me exponha a desafios, pois sou convicto de que eles possibilitam n\xe3o s\xf3 o desenvolvimento profissional e intelectual, mas principalmente exp\xf5em a situa\xe7\xf5es que agu\xe7am o senso de humanidade.","experiences",H.a([M.ud(520,"\nAtuo como volunt\xe1rio ao Instituto dos Engenheiros El\xe9tricos e Eletr\xf4nicos (**IEEE**). Inicialmente eu era integrante da divis\xe3o de cursos e membresias, e ajudava a produzir os editais de cursos e workshops organizados pelos alunos com o objetivo final de atrair mais estudantes. o IEEE \xe9 uma institui\xe7\xe3o mundial **sem fins lucrativos** que visa promover a integra\xe7\xe3o entre os cursos atrav\xe9s de **projetos** que estimulam a **aprendizagem** e fus\xe3o dos conhecimentos entre o pessoal dos cursos de Computa\xe7\xe3o, f\xedsica, automa\xe7\xe3o industrial e do ensino m\xe9dio integrado, sempre tendo como alvo final o **benef\xedcio \xe0 comunidade** que cerca o campus.\n\n**:Alguns projetos desenvolvidos**\n\n- Lab Kids(Ramo do IFB)\n- Cofre inteligente\n- Impressora 3d com sucata\n- Ponto de entrega volunt\xe1ria (PEV)\n- Mosqueteiras (visa incentivar a perman\xeancia e a entrada de meninas nos cursos de exatas)\n- RePlante (visa devolver pra natureza, os recursos gastos em nossas* atividades)\n",H.a([L.eD(C.jS,q,q)],p),"IEEE (05/2018 - agora)"),M.ud(230,"Atuei\xa0como\xa0estagi\xe1rio\xa0na\xa0Nova\xa0**T\xe9cnica\xa0Virtual**.\xa0Uma\xa0empresa\xa0da\xa0regi\xe3o\xa0de\xa0Bras\xedlia\xa0que\xa0possui\xa0um\xa0e-commerce\xa0voltado\xa0para\xa0o\xa0mercado\xa0de\xa0materiais\xa0el\xe9tricos.\xa0L\xe1\xa0eu\xa0era\xa0respons\xe1vel\xa0por\xa0gerenciar\xa0todo\xa0o\xa0sistema\xa0de\xa0e-commerce,\xa0garantindo\xa0que\xa0as\xa0informa\xe7\xf5es\xa0sempre\xa0estivessem\xa0atualizadas,\xa0buscando\xa0maneiras\xa0de\xa0aumentar\xa0a\xa0efici\xeancia\xa0dos\xa0processos\xa0internos\xa0com\xa0a\xa0plataforma\xa0da\xa0loja\xa0integrada\xa0entre\xa0outras\xa0atividades.\n",H.a([L.eD(C.jS,q,q)],p),"NT Virtual (01/2019 - 06/2019)"),M.ud(520,"        Me associei ao Cap\xedtulo de Computa\xe7\xe3o (Computer Chapter), onde atuo na divis\xe3o de projetos geralmente como desenvolvedor/designer. Atualmente temos dois projetos:\n\n**Planty** - Um aplicativo idealizado em parceria os alunos do curso de **automa\xe7\xe3o industrial**, que visa **incentivar** a comunidade a cuidar da \xe1rea verde de Bras\xedlia em troca de recompensas (estamos desenvolvendo um **dispositivo** especial onde pode ser armazenada **\xe1gua**, e o mesmo mede o volume restante compartilhando esse dado com o app. o projeto ainda est\xe1 em fase de **estudo**, e estamos buscando **parcerias**)\n\n**LiveBus** - Este projeto visa implantar um aplicativo eficiente e com um **design amig\xe1vel** que cumpra o desafio de rastrear **em tempo real** o **transporte p\xfablico** do Distrito Federal. Com alguns alunos envolvidos, temos tamb\xe9m o apoio do Akira Toyama (Engenheiro da Caixa Econ\xf4mica Federal, e presidente do IEEE Centro - Norte). Optamos por desenvolver esse app usando **Flutter**, e eu estive respons\xe1vel por **treinar** a equipe de desenvolvimento durante a pandemia at\xe9 termos condi\xe7\xf5es de iniciar o projeto.\n\nTamb\xe9m contribuo periodicamente com divis\xe3o de marketing.\n        ",H.a([L.eD(C.qA,q,q),L.eD(C.qG,q,q),L.eD(C.qz,q,q)],p),"Projetos IEEE (01/2019 - agora)"),M.ud(300,"Atuei na CASSI como estagi\xe1rio na **divis\xe3o de relacionamento com participantes (DRP)**, onde basicamente sou respons\xe1vel por:\n\n- Criar ferramentas de consulta, ger\xeancia e an\xe1lise para a divis\xe3o de relacionamento com participantes utilizando Excel e Access;\n- Respons\xe1vel por organizar e tratar todas as devolu\xe7\xf5es de cart\xf5es, reenviando os mesmos, quando poss\xedvel, ou destruindo-os, caso inativos;\n- Mediar algumas tarefas entre os funcion\xe1rios do DRP e as demais divis\xf5es da empresa.\n\n",H.a([L.eD(C.qB,q,q)],p),"CASSI (07/2019 - 12/2020)"),M.ud(550,"No Brasa Hacks (Organizado pela **Shawee**), idealizei junto a alguns amigos o que chamamos de **NuGasto!**, que se trata de uma feature para auxiliar os clientes do **Nubank** a organizarem suas finan\xe7as. A feature **agrupa** todos os gastos e ganhos do usu\xe1rio (aqueles lan\xe7ados pelo cart\xe3o de cr\xe9dito e tamb\xe9m aqueles da fun\xe7\xe3o d\xe9bito) e traz **an\xe1lises** das transa\xe7\xf5es em quest\xe3o. Ela permite que o usu\xe1rio defina **metas financeiras** que podem ser acompanhadas atrav\xe9s de an\xe1lises autom\xe1ticas da feature. Um dos principais objetivos do NuGasto! \xe9 auxiliar o usu\xe1rio a visualizar e analisar todos os seus gastos e ganhos em um lugar s\xf3. Por isso, criamos uma fun\xe7\xe3o onde ele pode **escanear o QR Code** de notas fiscais para lan\xe7\xe1-las automaticamente como uma despesa no banco de dados do Nubank. Al\xe9m disso, o usu\xe1rio teria acesso ao conte\xfado do blog do Nubank diretamente no app, por onde ele ganharia pontos seja realizando **testes din\xe2micos** ou ao atingir metas de controle financeiro. Toda a feature foi pensada para ser baseada nas atividades do usu\xe1rio, e tamb\xe9m gerenciada ao m\xe1ximo por ele, que por sinal teria o **poder** de lan\xe7ar e editar os seus gastos podendo tamb\xe9m definir as suas pr\xf3prias **metas de controle financeiro**. A nossa miss\xe3o era oferecer uma experi\xeancia personaliz\xe1vel, e ao mesmo tempo automatizada, tornando a tomada de decis\xf5es mais embasada atrav\xe9s de dados essenciais para o controle financeiro.\n",H.a([L.eD(C.qF,q,q),L.eD(C.qE,q,q),L.eD(C.qC,q,q)],p),"Brasa Hacks (02/2020)"),M.ud(530,"Ajudei a idealizar o **SafeBot**, um projeto no Hacka Gr1D Pocket - tamb\xe9m organizado pela Shawee. Ele se trata de um recurso que auxilia as seguradoras no processo de moderniza\xe7\xe3o do fluxo de trabalho dos seus corretores. A ideia era oferecer uma solu\xe7\xe3o **desburocratizada**, segura e disruptiva focada em tornar o trabalho do corretor mais c\xf4modo. Informa\xe7\xf5es pessoais de clientes sempre s\xe3o necess\xe1rias e por se tratarem dados sens\xedveis (ainda mais em tempos de LGPD), quase sempre h\xe1 um processo penoso e/ou burocr\xe1tico a cumprir para acess\xe1-las. Nesse projeto, n\xf3s defendemos que para uma solu\xe7\xe3o ser **segura** e tratar os dados pessoais dentro dos limites legais, ela **n\xe3o precisa oferecer uma experi\xeancia burocr\xe1tica**. A proposta do SafeBot \xe9 ser um local **seguro** onde o corretor possa obter dados inerentes a suas rela\xe7\xf5es com os clientes, tais como:\n\n- Sua carteira de clientes\n- Ver informa\xe7\xf5es como o hist\xf3rico de sinistros acionados por um cliente espec\xedfico E consultar dados comuns a todos os clientes (como data de nascimento, CPF etc)\n- Consultar o status de algumas documenta\xe7\xf5es espec\xedficas inerentes aos corretores\n\n[Link com mais detalhes do projeto](bit.ly/3bp0d9l)",H.a([L.eD(C.qH,q,q)],p),"Hacka GR1D Pocket (03/2020)")],H.U("p<oK>")),"certifications",H.a([new N.tx("https://images.ctfassets.net/q33z48p65a6w/1ciJXQwQjfgRWGcpyI1Oqp/21259688e6e67a17b93383bfa0e9bd0f/4._Partner_Icons_-_Udemy.png","Curso de Dartlang completo do b\xe1sico ao avan\xe7ado (Completo de verdade)","Acessar credencial")],H.U("p<tx>")),"skills",H.a([new B.x9("Java","https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Duke_%28Java_mascot%29_waving.svg/568px-Duke_%28Java_mascot%29_waving.svg.png")],H.U("p<x9>"))],t.N,t.K)})
